import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Grid,
  Card,
  CardContent,
  CardHeader,
  LinearProgress,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  Chip,
  Divider,
  Alert,
} from '@mui/material';
import {
  BarChart as ChartIcon,
  Add as AddIcon,
  Timeline as TimelineIcon,
  BubbleChart as ScatterIcon,
  ShowChart as LineIcon,
  PieChart as PieIcon,
} from '@mui/icons-material';
import PageHeader from '../components/common/PageHeader';

function Visualizations() {
  const location = useLocation();
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedFile, setSelectedFile] = useState(null);
  const [files, setFiles] = useState([]);
  const [loading, setLoading] = useState(false);
  const [analysis, setAnalysis] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchFiles();
    if (location.state?.openCreateDialog) {
      setOpenDialog(true);
      window.history.replaceState({}, document.title);
    }
  }, [location]);

  const fetchFiles = async () => {
    try {
      const response = await fetch('/api/files');
      const data = await response.json();
      setFiles(data.files || []);
    } catch (error) {
      console.error('Error fetching files:', error);
      setError('Failed to fetch files');
    }
  };

  const handleCreateClick = () => {
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setSelectedFile(null);
    setAnalysis(null);
  };

  const handleFileSelect = async (file) => {
    setSelectedFile(file);
    setLoading(true);
    setError(null);
    
    try {
      console.log('Analyzing file with ID:', file._id);
      const response = await fetch(`/api/files/${file._id}/analyze`);
      console.log('Analysis response status:', response.status);
      
      if (!response.ok) {
        const errorData = await response.json();
        console.error('Analysis error details:', errorData);
        throw new Error(errorData.error || 'Analysis failed');
      }
      
      const analysisData = await response.json();
      console.log('Analysis result:', analysisData);
      
      // Check the structure of analysis data and adapt as needed
      if (analysisData.success && analysisData.analysis) {
        setAnalysis({
          rowCount: analysisData.analysis.summary?.totalRows || 0,
          columns: Object.keys(analysisData.analysis.basicAnalysis || {}),
          visualizationSuggestions: [
            {
              type: 'bar',
              description: 'Bar Chart',
              reasoning: 'Based on data structure',
              confidence: 85
            },
            {
              type: 'line',
              description: 'Line Chart',
              reasoning: 'Good for trends over time',
              confidence: 75
            }
          ]
        });
      } else {
        setAnalysis({
          rowCount: 0,
          columns: [],
          visualizationSuggestions: []
        });
      }
    } catch (error) {
      console.error('Error analyzing file:', error);
      setError('Failed to analyze file');
    } finally {
      setLoading(false);
    }
  };

  const getVisualizationIcon = (type) => {
    switch (type) {
      case 'bar':
        return <ChartIcon />;
      case 'scatter':
        return <ScatterIcon />;
      case 'line':
        return <LineIcon />;
      case 'pie':
        return <PieIcon />;
      default:
        return <TimelineIcon />;
    }
  };

  return (
    <Box sx={{ p: 3 }}>
      <PageHeader
        title="Visualizations"
        icon={<ChartIcon />}
        actions={
          <Button
            variant="contained"
            startIcon={<AddIcon />}
            onClick={handleCreateClick}
          >
            Create Visualization
          </Button>
        }
      />

      <Grid container spacing={3} sx={{ mt: 2 }}>
        {files.length === 0 ? (
          <Grid item xs={12}>
            <Typography variant="body1" color="text.secondary">
              No files available for visualization. Upload files in the File Manager.
            </Typography>
          </Grid>
        ) : null}
      </Grid>

      <Dialog
        open={openDialog}
        onClose={handleCloseDialog}
        maxWidth="md"
        fullWidth
      >
        <DialogTitle>Create Visualization</DialogTitle>
        <DialogContent>
          {error && (
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          )}

          {!selectedFile ? (
            <>
              <Typography gutterBottom>
                Select a file to analyze and visualize:
              </Typography>
              <List>
                {files.map((file) => (
                  <ListItem
                    key={file._id}
                    button
                    onClick={() => handleFileSelect(file)}
                  >
                    <ListItemIcon>
                      <ChartIcon />
                    </ListItemIcon>
                    <ListItemText
                      primary={file.name}
                      secondary={`${file.type} - ${(file.size / 1024).toFixed(2)} KB`}
                    />
                  </ListItem>
                ))}
              </List>
            </>
          ) : (
            <Box>
              <Typography variant="h6" gutterBottom>
                Analysis for {selectedFile.name}
              </Typography>
              
              {loading ? (
                <Box sx={{ width: '100%', mt: 2 }}>
                  <LinearProgress />
                  <Typography sx={{ mt: 1 }} color="text.secondary">
                    Analyzing data...
                  </Typography>
                </Box>
              ) : analysis ? (
                <Box>
                  <Card sx={{ mb: 2 }}>
                    <CardHeader title="Data Summary" />
                    <CardContent>
                      <Typography>
                        Total rows: {analysis.rowCount}
                      </Typography>
                      <Typography>
                        Columns analyzed: {analysis.columns.length}
                      </Typography>
                    </CardContent>
                  </Card>

                  <Typography variant="h6" gutterBottom>
                    Recommended Visualizations
                  </Typography>
                  <List>
                    {analysis.visualizationSuggestions.map((suggestion, index) => (
                      <React.Fragment key={index}>
                        <ListItem>
                          <ListItemIcon>
                            {getVisualizationIcon(suggestion.type)}
                          </ListItemIcon>
                          <ListItemText
                            primary={suggestion.description}
                            secondary={suggestion.reasoning}
                          />
                          <Chip
                            label={`${suggestion.confidence}% confidence`}
                            color={suggestion.confidence > 80 ? 'success' : 'primary'}
                            sx={{ ml: 2 }}
                          />
                        </ListItem>
                        <Divider />
                      </React.Fragment>
                    ))}
                  </List>
                </Box>
              ) : null}
            </Box>
          )}
        </DialogContent>
        <DialogActions>
          {selectedFile && (
            <Button onClick={() => setSelectedFile(null)}>
              Back to File Selection
            </Button>
          )}
          <Button onClick={handleCloseDialog}>Cancel</Button>
          {analysis && (
            <Button variant="contained" onClick={handleCloseDialog}>
              Create Visualization
            </Button>
          )}
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default Visualizations;
